import React from 'react'
import changelog from '../../actions/changelog'

import dataBeta from '../../assets/bdd/dataBeta.json'

class Home extends React.Component {
    componentDidMount() {
        document.title = 'Charlinfo | Home';
        changelog.get()
            .then((data) => {
                console.log(data)
            })
    }

    render() {
        return (
            <div className="m-5">
                <h1 className="text-center m-4">Accueil</h1>
                {dataBeta.map((data) => (
                    <div key={data.title}>
                        <h4>{data.title}</h4>
                        <ul className="list-group list-group-flush mb-4">
                            {data.description.map((description) => (
                                <li key={description} className="list-group-item">{description}</li>
                            ))}
                        </ul>
                    </div>
                ))}
            </div>
        )
    }
}

export default Home
